using ICar.Infrastructure.Models;
using NUnit.Framework;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace ICar.Infrastructure.Tests.Models
{
    public class CarPictureTests
    {
        private readonly string _base64 = "data:image/jpeg;base64,";
        private readonly string _extension = "jpeg";
        private CarPicture _picture;

        [SetUp]
        public void SetUp()
        {
            string carId = Guid.NewGuid().ToString("N");
            _picture = new("Gustavo", carId, _base64);
        }

        [Test]
        public void TestGetPictureExtension_ArgumentIsABase64_ReturnsJpeg()
        {
            string result = CarPicture.GetPictureExtension(_base64);

            Assert.AreEqual(_extension, result);
        }

        [Test]
        public void TestGetPictureExtension_ArgumentIsNull_ReturnsNull()
        {
            string result = CarPicture.GetPictureExtension(null);

            Assert.AreEqual(null, result);
        }

        [Test]
        public void TestGenerateStoragePath_WhenCalled_ReturnsAStoragePath()
        {
            string userName = "Gustavo";
            string carId = Guid.NewGuid().ToString("N");

            _picture = new(userName, carId, _base64);

            var result = _picture.GenerateStoragePath();

            Assert.AreEqual($"{userName}/{carId}/{_picture.Id}.{_extension}", result);
        }
    }
}
